	return (
		<div className={ styles.ChallengesScreen }>
			<div className={ styles.wrapper }>
				<h2> Challenges </h2>
				<div className={ styles.oppCardWrapper }>
					<OpponentCard />
				</div>
			</div>
		</div>
	)
}
